import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap'; // Import LinkContainer

const NavigationBar = () => {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" sticky="top" className="navbar-custom">
      <LinkContainer to="/"> {/* Use LinkContainer for Navbar.Brand */}
        <Navbar.Brand>Starfires V2</Navbar.Brand>
      </LinkContainer>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          <LinkContainer to="/"> {/* Update each Nav.Link with LinkContainer */}
            <Nav.Link>Home</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/stargate">
            <Nav.Link>Stargate</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/library">
            <Nav.Link>Library</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/treasures">
            <Nav.Link>Treasures</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/mastery">
            <Nav.Link>Mastery</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/consultations">
            <Nav.Link>Consultations</Nav.Link>
          </LinkContainer>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default NavigationBar;
